import React from 'react';
import './settings_body.css';

const settings_body = props => {
  return (
      <div class="settings_body">
      <h1>Settings</h1>
        <div class="dkmode">
            <h3>Dark Mode</h3>
                <label class="switch">
                <input type="checkbox"/>
                <span class="slider round"></span>
                </label>
        </div>
      </div>
  )
}

export default settings_body;
